import React, { Component } from 'react';
import axios from 'axios';

class ListComponent extends Component {

    state = {
        property_list:[]
      }

    componentDidMount(){
        console.log("componentdid")
        axios.get('https://demo8808386.mockable.io/fetchProperties')
        .then(res =>{
          console.log(res['data']['data']);
          this.setState({property_list:res['data']['data']});
        });
      }


    render() {

      const list = this.state.property_list.map(property => {
        return (
          <div>
            <div>{property.propertyTitle}</div>
            <div>{property.propertySize}</div>
            <div>{property.rent}</div>
          </div>
        )
      });

      return (
        <div>
        <p>List</p>
        {list}
      </div>
      );
    }
  }

  export default ListComponent;
